import React, { useState } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
  Link,
} from "react-router-dom";
import LoginForm from "./components/LoginForm";
import HomePage from "./components/HomePage";
import ArticlesList from "./components/ArticlesList";
import OrderForm from "./components/OrderForm";
import OrderList from "./components/OrderList";
import CustomersList from "./components/CustomersList";
import NotFoundPage from "./components/NotFoundPage";
import { useSelector } from "react-redux";
import { selectToken } from "./features/auth/authSlice";
import LogoutButton from "./components/LogoutButton";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from 'reactstrap';
import patitoLogo from "./assets/patito.ico"; // Importa la imagen

const App = () => {
  const token = useSelector(selectToken);
  const [collapsed, setCollapsed] = useState(true);
  const toggleNavbar = () => setCollapsed(!collapsed);

  return (
    <Router>
      <div>
        <Navbar className="my-2" color="dark" dark>
          <NavbarBrand href="/">
            <img
              alt="logo"
              src={patitoLogo}
              style={{
                height: 40,
                width: 40,
              }}
            />
          </NavbarBrand>
          <NavbarToggler onClick={toggleNavbar} className="me-2" />
          <Collapse isOpen={!collapsed} navbar>
          <Nav navbar>
            <NavItem>
              <NavLink href="/articles">Articulos</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="https://github.com/reactstrap/reactstrap">
                GitHub
              </NavLink>
            </NavItem>
          </Nav>
        </Collapse>
        </Navbar>
        <nav>
          {token && (
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/articles">Articles List</Link>
              </li>
              <li>
                <Link to="/order-form">Order Form</Link>
              </li>
              <li>
                <Link to="/order-list">Order List</Link>
              </li>
              <li>
                <Link to="/customers-list">Customers List</Link>
              </li>
              <li>
                {" "}
                <LogoutButton />
              </li>
            </ul>
          )}
        </nav>
        <Routes>
          <Route
            path="/login"
            element={!token ? <LoginForm /> : <Navigate to="/" replace />}
          />
          <Route
            path="/"
            element={token ? <HomePage /> : <Navigate to="/login" replace />}
          />
          <Route
            path="/articles"
            element={token ? <ArticlesList /> : <Navigate to="/login" />}
          />
          <Route
            path="/order-form"
            element={token ? <OrderForm /> : <Navigate to="/login" replace />}
          />
          <Route
            path="/order-list"
            element={token ? <OrderList /> : <Navigate to="/login" replace />}
          />
          <Route
            path="/customers-list"
            element={
              token ? <CustomersList /> : <Navigate to="/login" replace />
            }
          />
          <Route path="*" element={<NotFoundPage />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
